import axios from 'axios'
import { createSlice } from '@reduxjs/toolkit'

const URL = 'http://127.0.0.1:8000'

export const counterSlice = createSlice({
    name: 'restaurants',
    initialState: {
        restaurants: [],
        loading: true
    },
    reducers: {
        get_products: (state) => {
            fetch(URL+'/api/').then(resp=>resp.json()).then(data=>console)
            // state.restaurants = restaurants
            state.loading = false
        }
    }
})

export const { get_products } = counterSlice.actions
export default counterSlice.reducer
